import React from 'react';
import "./AnnualReport.css"
  
const AnnualReport = () => {
  return (
    <div>
      <h1 className='ab-text'>Advantages of Bunzz</h1>
      <div>
      <p className='p-text'>Bunzz is developing a new tokenomics system that will reward module creators based on the frequency of usage. This will help to create a more sustainable and thriving ecosystem for DApp development.</p>
      </div>
      <p className='p-text'>1.Standardized smart contract modules: Bunzz provides a library of standardized smart contract modules that developers can use to build their DApps. This saves developers time and effort, as they don't need to start from scratch every time they want to build a new DApp.
<br></br>2.Audited smart contracts: Bunzz audits all of its smart contracts before they are deployed to the blockchain. This gives developers peace of mind knowing that their DApps are secure.
<br></br>3.Easy deployment: Bunzz makes it easy to deploy DApps to all EVM-compatible blockchains. Developers can deploy their DApps with just a few clicks.
<br></br>4.Integrated documentation generation: Bunzz can generate documentation for smart contracts from their code. This helps developers to document their DApps and make them easier to use for users.
<br></br>5.Community of developers: Bunzz has a large and active community of developers who are always willing to help each other out. This makes it a great place to learn and grow as a DApp developer. <br></br>
       Email Id: manish.mc20@bitsathy.ac.in , abishek.mc20@bitsathy.ac.in , mohamedfarhun.it20@bitsathy.ac.in
       </p>
    </div>
  );
};
  
export default AnnualReport;
